import React, { useState } from "react";

import "../profile/style-profile.css";
import Header from "../../components/Header";
import Footer from "../../components/Footer";
import AboutButton from "../../components/btns/AboutButton";
import ForumBtn from "../../components/btns/ForumBtn";
import GenericWrapper from "../../components/GenericWrapper";
import TodoBtn from "../../components/btns/TodoBtn";
import MotiTable from "./MotiTable";
import MotivatorBtn from "../../components/btns/MotivatorBtn";
import TempoGoals from "../profile/mains/TempoGoals";

function Warmer() {
  const goal1 = [
    {
      goal: "Career change",
      action: "Link below",
      id: 0.7419944699444685,
    },
  ];

  return (
    <GenericWrapper>
      <Header
        altBtn1={TodoBtn}
        altBtn2={ForumBtn}
        altBtn3={MotivatorBtn}
        altBtn4={AboutButton}
      ></Header>
      <h2>Welcome to the WARMER</h2>
      <h3>A system to remind you what should you be greateful for</h3>
      <main className="main-profile-container">
        <MotiTable
          dataTunnel={goal1}
          title={"finishing the portfolio"}
          deadline={"03.06.2023"}
        ></MotiTable>
      </main>
      <Footer></Footer>
    </GenericWrapper>
  );
}

export default Warmer;
